import './App.css';
import ProductList from './components/ProductList';
import Search from './components/Search';

function App() {
  const [products, setProducts] = useState([])

  useEffect(() => {
    ProductService.getAll().then((products) => {
      setProducts(products)
    });
  }, []);

  return (
    <div>
      <Search/>
      <ProductList/>
    </div>
  );
}

export default App;
